City_5.query:
q = load "${App.Datasets.SubwaySalesNYC2_tp.FullyQualifiedName}";
q = group q by 'City';
q = foreach q generate 'City' as 'City', avg('Food_Cost_Per_Month') as 'avg_Food_Cost_Per_Month', sum('Yearly_Sales')/12 as 'sum_Yearly_Sales';
q = order q by 'avg_Food_Cost_Per_Month' asc;
q = limit q 2000;

